def file_number(file_name):
    _index = [m.start() for m in re.finditer('_', file_name)][-1]
    ext_index = [m.start() for m in re.finditer('\.', file_name)][-1]
    return int(file_name[_index+1:ext_index])


# In[144]:

dir_in_CCD = sys.argv[1]

