# In[157]:

## getting average sigma in each cluster
FWHM = Data[:,5]
#print(Data.shape[0])
#plt.hist(FWHM, bins=100)
#plt.savefig('sigma calculado')
#plt.show()
factor = 2*np.sqrt(2*np.log(2))
sigmas = FWHM/factor
average_sigmas = {}
label_occurrencies = {}
for l in unique_labels:
    average_sigmas[l] = 0
    label_occurrencies[l] = 0

for i in range(Data.shape[0]):
    label = labels[i]
    sigma = sigmas[i]    
    average_sigmas[label] += sigma
    label_occurrencies[label] += 1

for label in unique_labels:
    sigma_sum = average_sigmas[label]
    average_sigmas[label] /= label_occurrencies[label]
    
# print(average_sigmas)
    


