# In[158]:

## getting average positions
x = Data[:,0]
y = Data[:,1]
average_positions = {}
for l in unique_labels:
    average_positions[l] = [0,0] #(sum of x, sum of y)

for i in range(labels.size):
    label = labels[i]
    average_positions[label][0] += x[i]
    average_positions[label][1] += y[i]

for label in unique_labels:
    x_avg = average_positions[label][0]/label_occurrencies[label]
    y_avg = average_positions[label][1]/label_occurrencies[label]
    average_positions[label] = [x_avg, y_avg]


# In[159]:

# getting esimated sigma for each cluster (label)
estimated_sigmas = {}
s = []
s_x = []
# print("label occurrencies -- indexes count -- count trues -- selected data shape")
for label in unique_labels:
    label_mask = np.zeros_like(labels, dtype=bool)
    indexes = np.where(labels == label)[0]
    label_mask[indexes] = True
    selected_data = Data[label_mask,:]
    x_thing = sum((selected_data[:,0]-average_positions[label][0])**2)
    y_thing = sum((selected_data[:,1]-average_positions[label][1])**2)
    count = label_occurrencies[label]
    estimated_sigmas[label] = np.sqrt((x_thing+y_thing)/(2*count-2))
    s_x.append(selected_data[0, :].std())
#print len(unique_labels)
#plt.clf()
#plt.hist(s_x,bins=100)
# plt.savefig('sigma estimado')
#plt.show()


