cuocient_average = 0
for label in unique_labels:
    cuocient = average_sigmas[label]/estimated_sigmas[label]
    sigma_comp[label] = (average_sigmas[label],estimated_sigmas[label],cuocient)
    cuocient_average += cuocient
cuocient_average /= len(sigma_comp)
